import Navbar from "../components/Navbar";

export default function Home() {
  return (
    <div className="bg-giCream min-h-screen">
      <Navbar />

      <main className="pt-20 px-6 pb-10 text-giGreen">
        <section className="max-w-5xl mx-auto text-left">
          <h1 className="text-4xl font-bold mb-2">Analisa Kebutuhan</h1>
          <h1 className="text-4xl font-bold mb-2">Nutrisi Harianmu</h1>
          <h1 className="text-4xl font-bold mb-6">
            dengan Mudah{" "}
            <span className="text-giGreen">pangan &amp; gizi</span>
          </h1>

          <p className="text-lg text-giGreen/80 max-w-xl mb-6">
            Satu tempat praktis untuk mengakses informasi{" "}
            <span className="text-giGreen">pangan &amp; gizi</span> makanan
            dengan cepat, akurat, dan terpercaya.
          </p>

          <button className="bg-giGreen text-white px-6 py-3 rounded-lg hover:bg-giGreen/90 transition">
            Mulai
          </button>
        </section>
      </main>
    </div>
  );
}
